// admin.js
import React from "react";
import { useLocation, useNavigate } from "react-router-dom";

const Admin = () => {
  const location = useLocation();
  const navigate = useNavigate();

  return (
    <div>
      <h2>Admin Page</h2>
      {/* Display admin-related information */}
      <p>
        <strong>Roll Number:</strong> {Data.roll_number}
      </p>
      <p>
        <strong>Admin Name:</strong> {Data.student_name}
      </p>
      {/* Add any other admin details you want to display */}

      <h3>Department Details:</h3>
      {departmentDetails && departmentDetails.length > 0 ? (
        <div
          style={{ display: "flex", textAlign: "center", alignItems: "center" }}
        >
          <div style={{ marginRight: "20px" }}>
            <p>
              <strong>Department:</strong>
            </p>
            <div style={{ marginRight: "20px" }}>
              <p>
                <strong>Status:</strong>
              </p>
            </div>
          </div>

          {departmentDetails.map((detail, index) => (
            <div key={index} style={{ marginRight: "20px" }}>
              <p>{detail.department_name}</p>
              <p>{detail.status}</p>
            </div>
          ))}
        </div>
      ) : (
        <p>No department details available.</p>
      )}
    </div>
  );
};

export default Admin;
